import React from 'react'

const MealPlanWeekResults = ({meals}) => {

    const mealsList = meals.map(meal => {
        const title = JSON.parse(meal.value).title
        return (
            <div className="mealResultContainer">
                { title }
            </div>
        )
    })

    return (
        <>
            { mealsList }
        </>
    )
}

export default MealPlanWeekResults
